<?phpnamespace Nemundo\Meteo\MeteoschweizBlog\Install;use Nemundo\App\Application\Setup\ApplicationSetup;use Nemundo\App\Application\Type\Install\AbstractInstall;use Nemundo\Content\App\Feed\Application\FeedApplication;use Nemundo\Content\App\Feed\WebCrawler\FeedWebCrawlerSetup;use Nemundo\Content\App\Timeline\Application\TimelineApplication;use Nemundo\Meteo\MeteoschweizBlog\Application\MeteoschweizBlogApplication;use Nemundo\Meteo\MeteoschweizBlog\Crawler\MeteoschweizBlogCrawler;class MeteoschweizBlogInstall extends AbstractInstall{    public function install()    {        (new TimelineApplication())->installApp();        (new FeedApplication())->installApp();        (new ApplicationSetup())->addApplication(new MeteoschweizBlogApplication());        (new FeedWebCrawlerSetup())            ->addWebCrawler(new MeteoschweizBlogCrawler());    }}